import PropTypes from 'prop-types';

export default function Logout({ setToken }) {
    return(
        <main className='logout'>
            <div className='help'>
                help
            </div>
            <form>
                <button className='logout-btn' onClick={() => setToken(null)}>Logout</button>
            </form>
        </main>
    );
}

Logout.propTypes = {
    setToken: PropTypes.func.isRequired
}
